import './App.css';
import logo from './images/Semantic_Scholar_logo.svg.png';
import TextField from "@mui/material/TextField";

function App() {
    return (
        <div className="App">
            <header className="App-header">
                Semantic Scholar Super Search
                <img src={logo} alt="Logo" className='logo_image'/>
            </header>

            <div className='search'>
                <span>Search In Papers</span>
                <TextField
                    id="outlined-basic"
                    variant="outlined"
                    fullWidth
                    label="Search"
                />
            </div>
        </div>
    );
}

export default App;
